import React from "react";
import Navbar from "../../components/navbar";
import Banner from "../../components/banner";
import Grid from "../../components/grid";
import Collage from "../../components/collage"
import Bio from "../../components/bio"
import Contact from "../../components/contact";
import Footer from "../../components/footer";
import { Link } from "react-router-dom";

require ("./home.css");

class home extends React.Component {
    constructor(props) {
    super(props);
        this.state = {

        }
    }

    render() {
        return (
            <div id="homeMainContainer" className="container-fluid" data-spy="scroll" data-target="#list-example" data-offset="0">
                <div id="homeResponsiveTopNav" className="d-flex justify-content-center">
                <div className="homeResponsiveTopNavHome">
                        <div className="">
                            <a className="homeResponsiveTopNavHoverHome justify-content-center align-items-center topNavText" href="#bannerMainContainer">Home</a>   
                        </div>
                    </div>
                    <div className="homeResponsiveTopNavGrid">
                        <div className="homeResponsiveTopNavHoverGrid">
                            <a className="justify-content-center align-items-center topNavText" href="#mainGridContainer">Grid</a>
                        </div>
                    </div>
                    <div className="homeResponsiveTopNavBio">
                        <div className="homeResponsiveTopNavHoverBio">
                            <a className="justify-content-center align-items-center topNavText" href="#bioMainContainer">Bio</a> 
                        </div>
                    </div>
                    <div className="homeResponsiveTopNavContact">
                        <div className="homeResponsiveTopNavHoverContact">
                            <a className="justify-content-center align-items-center topNavText" href="#contactMainContainer">Contact</a>
                        </div>
                    </div>
                    <div className="homeResponsiveTopNavMoreInfo">
                        <div className="homeResponsiveTopNavHoverMoreInfo">
                            <a className="justify-content-center align-items-center topNavText" href="#mainFooterContainer">More Info</a> 
                        </div>
                    </div>
                </div>
                <Banner />
                <Grid />
                {/* <Collage /> */}
                <Bio />
                <Contact />
                <Footer />
            </div>
        )
    }
}

export default home;
